import React from 'react';
import { useNavigate } from 'react-router-dom';
import './App.css';
import axios from 'axios';

export function Home(){

    const navigate = useNavigate();
    return (
        <div className="App">
            <div>
                <button className="btn btn-success" onClick={()=> navigate('/task')}>
                    Tasks
                </button><br />
            </div>
        </div>
    );
}
